    current_line = ""
    current_indent = 0
    wait_for_nl = False
    for char in prefix:
        if wait_for_nl:
            if char == '\n':
                # Determine the correct indentation for the comment
                comment_indent = "\t" * (current_indent // 4) + " " * (current_indent % 4)
                current_line += comment_indent
                lines.append(current_line)
                current_line = ""
                current_indent = 0
                wait_for_nl = False
        elif char == ' ':
            current_indent += 1
        elif char == '\t':
            current_indent += 4
        elif char == '\n':
            current_indent = 0
        else:
